a:260:{i:0;a:1:{s:2:"id";s:19:"2391127632329439010";}i:1;a:1:{s:10:"short_code";s:11:"CEu_emxnfci";}i:2;a:1:{s:12:"created_time";i:1599264647;}i:3;a:1:{s:7:"caption";s:1941:"Siapa yang tidak tahu penyakit tekanan darah tinggi? Di postingan sebelumnya Sahabat Medity Indonesia sudah dijelaskan apa itu tekanan darah tinggi. Tetapi, apakah Sahabat Medity Indonesia juga tahu kalau hipertensi adalah penyebab kematian nomor satu di dunia setiap tahunnya loh.

Data dari WHO tahun 2015, menunjukkan sekitar 1,13 Miliar orang di dunia terkena hipertensi, artinya 1 dari 3 orang di dunia mempunyai penyakit hipertensi. Diperkirakan pada tahun 2025 akan ada 1,5 Miliar orang yang terkena hipertensi, dan setiap tahunnya  bakal ada 9,4 juta orang meninggal akibat hipertensi dan komplikasinya.

Diketahui perkiraan jumlah kasus Hipertensi di Indonesia adalah 34,1%, TETAPI hanya 8,8% yang terdiagnosis Hipertensi. Artinya, 91,2% penderita Hipertensi tidak mengetahui dirinya terkena hipertensi. Pasien yang tidak minum obat rutin sebesar 32,3%.

Data dari Kemenkes, bahwa Alasan penderita hipertensi tidak minum obat antara lain karena:

°Penderita hipertensi merasa sehat (59,8%),
°Kunjungan tidak teratur ke fasyankes (31,3%),
°Minum obat tradisional (14,5%),°Menggunakan terapi lain (12,5%),
°Lupa minum obat (11,5%),
°Tidak mampu beli obat (8,1%),°Terdapat efek samping obat (4,5%), dan
°Obat hipertensi tidak tersedia di Fasyankes (2%).

Sekali lagi, Hipertensi disebut sebagai “the silent killer” karena sering tanpa keluhan. Penderita tidak mengetahui dirinya menyandang hipertensi dan baru diketahui setelah terjadi komplikasi. Karena itu PENTING SEKALI untuk periksa tekanan darah secara berkala.

INGAT: Hipertensi adalah pembunuh nomor 1 di dunia.

Ayo ikuti postingan Medity Indonesia lebih lanjut untuk cari tahu cara menghindari dan mengobati Hipertensi dengan benar.

